data:
  definition: nom ou adresse d'une ressource Internet, mémorisé sur le site d'un utilisateur
    pour faciliter un accès ultérieur
  examples: []
  notes:
  - Un signet contient généralement une adresse URL, un nom donné à la ressource par
    l'utilisateur, et éventuellement des notes de celui-ci
  - Les synonymes sont utilisés par des logiciels de navigation particuliers.
